  // Takes an array of ElevationResult objects, draws the path on the map
  // and plots the elevation profile on a GViz ColumnChart
  function plotElevation(results) {
    elevations = results;
    
    var path = [];
    for (var i = 0; i < results.length; i++) {
      path.push(elevations[i].location);
    }
    
    if (polyline) {
      polyline.setMap(null);
    }
    
    polyline = new google.maps.Polyline({
      path: path,
      strokeColor: "#00FFFF",
      map: map});
    
    var data = new google.visualization.DataTable();
    var jrk = polyline.Distance();
    var pjg = polyline.Distance() / (results.length-1);
    var deg = polyline.Bearing();
    var anthg = document.getElementById("anthg").value;
    anthgt = anthg.split(";");
    if (anthgt.length == 2){
    	to = anthgt[1];
    }
    else {
    	to = 0;
    }
    th = anthgt[0];
    tilt = document.getElementById("tilt").value;
    hpbw = document.getElementById("hpbw").value;
    data.addColumn('number', 'Sample');
    data.addColumn('number', 'Elevation');
    data.addColumn('number', 'MainLobe');
    data.addColumn('number', 'UVHPBW');
    data.addColumn('number', 'LVHPBW');
    dp = (+th + elevations[0].elevation - elevations[SAMPLESm1].elevation - to)/SAMPLES;
    EndPoint = (Math.atan2(dp, pjg)) * (180/Math.PI);
    EndPoint  = Math.round(EndPoint * 100) / 100;
    data.addColumn('number', EndPoint + '\xB0');
    for (var i = 0; i < results.length; i++) {
      elv = elevations[i].elevation;
      mlx = elevations[0].elevation + +th - (pjg * i * Math.tan(Math.PI / (180 / tilt)));
      ml = (mlx <= elv-2) ? null : mlx;
      tiltu  = +tilt-(hpbw/2);
      ulx = elevations[0].elevation + +th - (pjg * i * Math.tan(Math.PI / (180 / (tiltu))));
      ul = (ulx >= mlx*2) ? null : ulx;
      ul = (ul <= elv*2) ? ulx : ul;
      ul = (ulx <= elv-2) ? null : ulx;
      tiltl = +tilt+(hpbw/2);
      llx = elevations[0].elevation + +th - (pjg * i * Math.tan(Math.PI / (180 / (tiltl))));
      ll = (llx <= elv-2) ? null : llx;
      epx = +th + elevations[0].elevation - (i*dp);
      ep = (epx <= elv-1) ? null : epx;
      data.addRow([pjg*i, elv, ml, ul, ll,ep]);
    }

    document.getElementById('chart_div').style.display = 'block';
    chart.draw(data, {
      //title : '(' + elevations[0].location.H.toFixed(5) + ', ' + elevations[0].location.L.toFixed(5) + '), (' + elevations[SAMPLESm1].location.H.toFixed(5) + ', ' + elevations[SAMPLESm1].location.L.toFixed(5) + '), ' + deg + '\xB0',
      title : elevations[0].location + ', ' + elevations[SAMPLESm1].location + ', ' + Math.round(jrk*100) / 100 + 'm' + ', ' + deg + '\xB0',
      series: {0: {type: "bars"}},
      bar: {groupWidth: '100%'},
      width: 900,
      height: 200,
      legend: 'none',
      titleY: 'Elevation (m)',
      titleX: 'Distance (m)',
      focusBorderColor: '#00ff00'
    });
  }

  // Trigger the elevation query for point to point
  // or submit a directions request for the path between points
  function updateElevation() {
    if (markers.length > 1) {
      var travelMode = document.getElementById("mode").value;
      if (travelMode != 'direct') {
        calcRoute(travelMode);
      } else {
        var latlngs = [];
        for (var i in markers) {
          latlngs.push(markers[i].getPosition())
        }
        elevationService.getElevationAlongPath({
          path: latlngs,
          samples: SAMPLES
        }, plotElevation);
      }
    }
  }

  // Submit a directions request for the path between points and an
  // elevation request for the path once returned
  function calcRoute(travelMode) {
    var origin = markers[0].getPosition();
    var destination = markers[markers.length - 1].getPosition();
    
    var waypoints = [];
    for (var i = 1; i < markers.length - 1; i++) {
      waypoints.push({
        location: markers[i].getPosition(),
        stopover: true
      });
    }
    
    var request = {
      origin: origin,
      destination: destination,
      waypoints: waypoints
    };
   
    switch (travelMode) {
      case "bicycling":
        request.travelMode = google.maps.DirectionsTravelMode.BICYCLING;
        break;
      case "driving":
        request.travelMode = google.maps.DirectionsTravelMode.DRIVING;
        break;
      case "walking":
        request.travelMode = google.maps.DirectionsTravelMode.WALKING;
        break;
    }
    
    directionsService.route(request, function(response, status) {
      if (status == google.maps.DirectionsStatus.OK) {
        elevationService.getElevationAlongPath({
          path: response.routes[0].overview_path,
          samples: SAMPLES
        }, plotElevation);
      } else if (status == google.maps.DirectionsStatus.ZERO_RESULTS) {
        alert("Could not find a route between these points");
      } else {
        alert("Directions request failed");
      }
    });
  }

	function select_title()
	{
  	for (key in sites){
			var searchField = document.getElementById("page_title");
      var resultsDiv = document.getElementById("results");
      //var searchField = form.search;

      // first, position the results:
      var node = searchField;
      var x = 0;
      var y = 0;
      while ( node != null )
      {
          x += node.offsetLeft;
          y += node.offsetTop;
          node = node.offsetParent;
      }
      resultsDiv.style.left = x + "px";
      resultsDiv.style.top  = (y + 20) + "px";
      
      // now, attach the keyup handler to the search field:
      searchField.onkeyup = function()
      {
          var txt = this.value.toLowerCase();
          if ( txt.length == 0 ) return;

          var txtRE = new RegExp( "(" + txt + ")", "ig" );
          // now...do we have any matches?
          var top = 0;
          for (key in sites){
							var srch = sites[key][0];
              if ( srch.toLowerCase().indexOf(txt) >= 0 )
              {
                  srch = srch.replace( txtRE, "<span>$1</span>" );
                  var div = document.createElement("div");
                  div.innerHTML = srch;
                  div.onclick = function() {
                      searchField.value = this.innerHTML.replace(/\<\/?span\>/ig,"");
                      resultsDiv.style.display = "none";
                      j_site_id = searchField.value.split(" - ")[0];
                      //alert(typeof sites[j_site_id][1] + '\n\n' + typeof sites[j_site_id][2]);
                      loadSite(j_site_id, false);
                      //siteSector(j_site_id);
                      map.setCenter({lat: sites[j_site_id][1], lng: sites[j_site_id][2]});
                  };
                  div.style.top = top + "px";
                  top += 20;
                  resultsDiv.appendChild(div);
                  resultsDiv.style.display = "block";
              }
          }
      }
      // and the keydown handler:
      searchField.onkeydown = function() 
      {
          while ( resultsDiv.firstChild != null )
          {
              resultsDiv.removeChild( resultsDiv.firstChild );          
          }
          resultsDiv.style.display = "none";
      }
		}
	}
